- input: TEXT,H3,,"We understand that Commission regulations provide in most instances
    for a 70-day window during which a transfer from the nonfederal account may be
    made to cover the nonfederal share of joint activity. We understand further that
    neither the 10-day pre-payment period nor the 60-day post-payment period is affected
    by the end of a reporting period or the end of a calendar year.    The committee
    made and reported allocable expenditures toward the end of 2002 for which the
    nonfederal transfers were not made until January 2003. Our records show that of
    the nonfederal transfers disclosed on Line 18 of this report $81788.55 was transferred
    to cover the nonfederal share of allocable expenditures made in November and December
    of 2002. The transfers were made on January 8 9 27 and 31 2003 and all were made
    within the 60-day period following the original allocable expenditures.   ",
