- input: 'TEXT,H4,,"As you know during the first half of 2003 the committee devoted
    extraordinary time and effort to reviewing and reconciling our 2002 financial
    records and to making necessary amendments to reports. During the course of that
    extensive review we found that a number of checks issued in early 2002 had not
    cleared the bank. Our research showed that the payments were duplicate payments
    (the bill had already been paid) or were issued on mistaken information. In none
    of these cases did the committee receive services from for example a corporate
    vendor for which it did not fully pay.    The committee treated these voided or
    returned checks as it does most other small allocable refunds rebates or reimbursements-following
    the method and examples outlined in AO 1995-22 and as Method 1 on page 61 of the
    Campaign Guide for Political Party Committees. The nonfederal portion of any allocable
    refund rebate or reimbursement is transferred-out by adjusting a subsequent nonfederal
    transfer-in (under-transferring to take into account the nonfederal share of allocable
    refunds or reimbursements or as in this case voided checks).      No additional
    transfer-out of the nonfederal portion of these voided checks is needed. As you
    can see the committee is substantially under-transferred for 2003; we have in
    fact transferred-in much less nonfederally than we are entitled to transfer (because
    $81788.55 transferred-in was for 2002 allocable expenditures; see explanation
    on Schedule H3). We also point out that during 2002 the committee''s nonfederal
    transfers were also substantially less than we were entitled to transfer: The
    nonfederal share of all 2002 allocable activities (Line 21 a ii) was $14169952.86
    and the amount transferred (Line 18) was $12986719.28. Even if you add to that
    Line 18 amount the additional $81788.55 transferred in 2003 for 2002 allocable
    expenditures the committee still could have transferred-in more than a million
    dollars more for 2002.   ",'
  record: <fec.version.v5_0.TEXT.Records instance at 0x34f8b90>
